import React from "react";
import { Header, Footer } from "./components";
import { Container } from "react-bootstrap";
import { HomeScreen } from "./screens";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
function App() {
  return (
    <Router>
      <Routes>
        <Header />
        <main className="py-3">
          <Container>
            <HomeScreen />
          </Container>
        </main>
        <Footer />
      </Routes>
    </Router>
  );
}

export default App;
